import React from 'react';
import VideoPlayer from './VideoPlayer';


const App = () => {
  return (
    <div>
      <h1 style={color = 'blue'}><center>YouTube Video Player</center></h1>
      <VideoPlayer />
    </div>
  );
};

export default App;
